  input: TEXT,F3A,,"In response to your 12/31/02 notice, please be advised of the
    following.  Regarding the six contributors who you have indicated were reported
    on October 21st and 22nd 48 Hour Notices but do not appear on Schedule A of the
    Post General Report, my findings are as follows.   These contributors appear twice
    on the 48 Hour Notices.  Four appear on a 10/21 notice, two appear on a 10/22
    notice and all six appear again on a 10/29 notice.  My software does not show
    the 10/21 and 10/22 48 Hour Notices for some reason.  It does show the 10/29 notice
    listing these six contributors who all appear on Schedule A for that date.  These
    contributions were duplicated as a result of, I suspect, a computer malfunction.  With
    regards to the second paragraph of this notice, I have spoken with the Reports
    Analysis Division and have been informed that a loan from the candidate in the
    amount of $25,000 was reported on 10/29/02 on the Schedule A but was not reported
    on a 48-Hour Notice.  I have researched this and found this information to be
    correct.  An oversight on our part, no 48 Hour Notice was filed for this loan."
